function App() {
  return (
    <Container className="justify-content-md-center">
    <div className="Title">Pide tu pizza Ya!</div>
    <Row >
      <Col>
        <Card>

        </Card>
      </Col>
      <Col>
        <img
          className="ml-3"
          src={imgPizza}
          alt="Pizza"
        />
      </Col>
    </Row>
  </Container>
  );
}

export default App;
